import React from "react";
import { Link } from "react-router-dom";
import "../assets/styles.css";
import "../assets/home-dark.css";

import rustgamedark from "../assets/img/rustgamedark.jpg";

function VideoBackground() {
  const videoRef = React.useRef(null);

  // archivo en: public/video/animated.mp4
  const src = "/video/animated.mp4";

  const [status, setStatus] = React.useState("loading"); // loading | ready | error
  const [ready, setReady] = React.useState(false);
  const [bufferPct, setBufferPct] = React.useState(0);

  React.useEffect(() => {
    const v = videoRef.current;
    if (!v) return;

    setReady(false);
    setStatus("loading");
    setBufferPct(0);

    v.muted = true;
    v.defaultMuted = true;
    v.volume = 0;

    const checkBuffered = () => {
      const dur = v.duration;
      if (!Number.isFinite(dur) || dur <= 0) return;

      const b = v.buffered;
      if (!b || b.length === 0) return;

      const end = b.end(b.length - 1);
      const pct = Math.max(0, Math.min(1, end / dur));
      setBufferPct(pct);

      // "100% cargado": cuando el buffer cubre casi toda la duración
      if (end >= dur - 0.05) {
        setReady(true);
        setStatus("ready");
      }
    };

    const onLoadedMeta = () => checkBuffered();
    const onProgress = () => checkBuffered();
    const onCanPlay = () => checkBuffered();
    const onError = () => setStatus("error");

    v.addEventListener("loadedmetadata", onLoadedMeta);
    v.addEventListener("progress", onProgress);
    v.addEventListener("canplay", onCanPlay);
    v.addEventListener("error", onError);

    try { v.load(); } catch (_) {}
    try {
      const p = v.play();
      if (p && typeof p.catch === "function") p.catch(() => {});
    } catch (_) {}

    // polling por si el browser no emite progress seguido
    const t = window.setInterval(checkBuffered, 250);

    return () => {
      window.clearInterval(t);
      v.removeEventListener("loadedmetadata", onLoadedMeta);
      v.removeEventListener("progress", onProgress);
      v.removeEventListener("canplay", onCanPlay);
      v.removeEventListener("error", onError);
    };
  }, [src]);

  return (
    <div className="video-bg" aria-hidden="true">
      <div className="video-bg__poster" style={{ backgroundImage: `url(${rustgamedark})` }} />

      <video
        ref={videoRef}
        className="video-bg__media"
        autoPlay
        muted
        loop
        playsInline
        preload="auto"
        controls={false}
        style={{ opacity: ready ? 1 : 0, transition: "opacity 240ms ease" }}
      >
        <source type="video/mp4" src={src} />
      </video>

      {/* Debug mínimo (quitar después) */}
      <div
        style={{
          position: "fixed",
          left: 12,
          bottom: 12,
          zIndex: 50,
          padding: "6px 10px",
          fontSize: 12,
          borderRadius: 10,
          background: "rgba(0,0,0,0.55)",
          border: "1px solid rgba(255,255,255,0.10)",
          color: "#fff"
        }}
      >
        video: {status} | buffered: {Math.round(bufferPct * 100)}%
      </div>
    </div>
  );
}

export default function Home() {
  React.useEffect(() => {
    document.body.classList.add("has-video-bg");
    return () => document.body.classList.remove("has-video-bg");
  }, []);

  return (
    <div className="home-dark has-video-bg">
      <VideoBackground />

      <main style={{ position: "relative", zIndex: 20, padding: "5rem 1rem" }}>
        <div className="panel" style={{ maxWidth: 900, margin: "0 auto" }}>
          <h1 style={{ marginTop: 0 }}>Rustaco</h1>
          <p className="regla-body">
            El video se muestra cuando está 100% bufferizado.
          </p>
          <div style={{ display: "flex", gap: 10, flexWrap: "wrap" }}>
            <Link to="/equipos" className="btn-primary">Equipos</Link>
            <Link to="/reglas" className="btn-primary">Reglas</Link>
          </div>
        </div>
      </main>
    </div>
  );
}
